import { useAuth } from "../context/AuthContext";

const Sidebar = () => {
  const { user, logout } = useAuth();

  return (
    <div>
      <p>{user.username}</p>
      <p>{user.role}</p>
      <button onClick={logout}>Logout</button>
    </div>
  );
};
